import React from 'react';

const InputFilter = ({label, name,value, onChangeHandler}) => {
    return(
        <>
            <label htmlFor={name} id={name} name={name}>{label}</label>
            <input type="text" id={name} name={name}
            value={value}
            onChange={(e)=>onChangeHandler(e)}
            />
        </>
    )
}

const Filters = ({setMinPriceHandler, setMaxPriceHandler, minPrice, maxPrice}) => {
    return (
        <form action="">
            <InputFilter label="Price(min): " name="minPrice" value={minPrice} onChangeHandler={setMinPriceHandler}/> 
            <InputFilter label="Price(max): " name="maxPrice" value={maxPrice} onChangeHandler={setMaxPriceHandler}/> 
        </form>
    )
}

export default Filters;
